questionvariables.text:
p_i: 2 + rand(3);
q_i: 2 + rand(3);
q_j: 2 + rand(3);
argCos: (p_i*q_i + q_j)/sqrt((p_i^2 + 1)*(q_i^2 + q_j^2));
invCos: float(acos(argCos));
ta: 0.1*round(10*float((invCos*180)/%pi));

p1: 2 + rand(2);
p2: 2 + rand(2);
q1: 2 + 2*rand(2);
q2: 2 + rand(2);
ta: is(p1*q1 - p2*q2 = 0);

/* Needed for solution */
simp: false;
prod: p1 * q1 + p2 * q2;
prods: ev(prod, simp);
clas: if ta = true
  then "perpendicular"
  else "not perpendicular";

p_i: 2 + rand(3);
q_i: 2 + rand(3);
q_j: 2 + rand(3);
argCos: (p_i*q_i + q_j + 2)/sqrt((p_i^2 + 2)*(q_i^2 + q_j^2 +4));
invCos: float(acos(argCos));
ta: 0.1*round(10*float((invCos*180)/%pi));

charge_fact: 1 + rand(8);
ta_2: decimalplaces(charge_fact*19.57,2);
ta_3: decimalplaces(charge_fact*25.72,2);
